import React from 'react';
import {Text, StyleSheet, View, TextInput} from 'react-native';
import LabelCampoo from './LabelCampoo';

export default class InputCampoo extends React.Component 

{

    render()
    
    {

        
        return(

         <View style={[styles.inputView, this.props.style]}>
   

            <Text style={styles.textMail}>{this.props.description}</Text>
           
            <TextInput style={styles.textInput} secureTextEntry={this.props.secure}  maxLength={40}/>

         </View>

        );

    }

}

const styles = StyleSheet.create({

    inputView:{
        width : '100%',
       
        
        
    },
    label:{
        
        marginLeft:8,
        marginBottom:15,
        
     }, 
    textInput : {
        paddingHorizontal:10,
        height : 30,
        borderWidth : 1 ,
        borderColor : '#4D3D64',
        width :"100%",
        borderRadius:5,

    },
    
    textMail:{
        marginBottom:10,

        fontSize:11,
        textAlign:'center',
        color:'#4D3D64',
  
       
     },
 


})
